social_posts.post_text:
@onebarrelenglewood should be at the top of your list when planning your next date night! 

A comfortable and inviting ambiance sets the stage for a delicious seasonally inspired menu. When you pair that with a great and reasonable wine list you've got yourself the recipe for an excellent evening...And that's just what I had when checking out @onebarrelenglewood ! 

Thank you for the wonderful hospitality 💜 Also thank you to @ocn_eats for the invite!

Save for your weekend brunch plans 

@sunnysidesupperclub checks all the boxes. Unique and flavorful mimosas, seasonal local ingredients, a bright airy space, and delicious food including the best in house made smoked mozzarella you'll ever try. 

Add them to the list asap 💨
